import { Header } from "../../components/Header/header.js";
import Box from "@mui/material/Box";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";
import Button from "@mui/material/Button";
import Stack from "@mui/material/Stack";
import Typography from "@mui/material/Typography";
import { requirePropFactory } from "@mui/material";
import home from "../../assets/images/home.svg";
import { styled } from "@mui/system";

const StyledTab = styled((props) => <Tab disableRipple {...props} />)(
    ({ theme }) => ({
      textTransform: 'none',
      fontFamily: 'Inter',
      fontSize:"calc(1em + 1vw)",
      marginTop: "5vh",
      marginLeft: "10%",
      color: "white",
      '&:hover': {
        backgroundColor: 'black'
      },
    }),
  );

export const Account = () => {
    return (
        <Box>
            <Header />
            <Box sx={{display:"flex", height:'77.69vh', width:'100vw'}}>
                <Tabs orientation="vertical" sx={{backgroundColor: "#9146D8", width:"15vw",borderRadius:"0px 20px 0px 0px", height:"77.69vh"}}>
                    <StyledTab label="PROFILE" />
                    <StyledTab label="UPCOMING" />
                    <StyledTab label="LEAGUE" />
                    <StyledTab label="RESULTS"/>
                    <StyledTab label="FRIENDS" />
                    <StyledTab label="SETTINGS" />
                </Tabs>
            </Box>
        </Box>
    );
}
